import React from 'react';

//const Header = () => {
//  return <h2>This is header space</h2>
//}

class Header extends React.Component{
render(){
    const styles = {
        header:{
            background:'#038DB9'
        },
        logo:{
            color:'#fff',
            fontSize:'35px'
        }

    }
    return(
    <header style={styles.header}>
        <div style={styles.logo}>LOGO</div>
       <input/>
    </header>
    )
}
}

export default Header;
